import Dashboard from '../../app/Appdashboard'


const DashboardRefresh = (day, medicion) => {
    
    let days = []; 
    let mediciones = [];
    mediciones.push(medicion);
    days.push(day);
    
    return (
        <Dashboard
            title="Tension bateria"
            subheader="Panel solar 500mA"
            chartLabels={days}
            chartData={[
                // {
