                //     data: [23, 11, 22, 27, 13, 22, 37, 21, 44, 22, 30],
                // },
                {
                    name: 'Team B',
                    type: 'area',
                    fill: 'gradient',
                    data: mediciones,
                },

            ]}
        />
    );
}

export default DashboardRefresh;
